import React, { useEffect, useState } from 'react';
import './home.css';
import Header from './header.js';
import image1 from './assets/partner1.jpg'; // replace with your actual image path
import image2 from './assets/partner2.jpg'; // replace with your actual image path

const Home = () => {

    const [isVisible, setIsVisible] = useState(false);

    useEffect(() => {
        const timer = setTimeout(() => {
            setIsVisible(true);
        }, 6000);

        return () => clearTimeout(timer);
    }, []);

    return (
        <div className="homepage">
            <div className='header-div'>
                <Header />
            </div>
            <div className={`content ${isVisible ? 'show' : ''}`}>
                <h1>Our Partners</h1>
                <div className={`tiles-container ${isVisible ? 'show' : ''}`}>
                    <a href="https://www.tatatelebusiness.com" target="_blank" rel="noopener noreferrer">
                        <div className="tile">
                            <img src={image1} alt="Partner 1" />
                        </div>
                    </a>
                    <a href="https://www.vodafone.com" target="_blank" rel="noopener noreferrer">
                        <div className="tile">
                            <img src={image2} alt="Partner 2" />
                        </div>
                    </a>
                </div>
                <div className={`number ${isVisible ? 'show' : ''}`}>
                    <h2>Call Us</h2>
                    <span>9633220088</span>
                </div>
            </div>
        </div>
    );
};

export default Home;
